
CREATE OR REPLACE FUNCTION do_nothing()
RETURNS TRIGGER AS
$do_nothing$
DECLARE

BEGIN
        RAISE EXCEPTION 'Forbidden operation';
END;

$do_nothing$
LANGUAGE plpgsql;

CREATE TABLE currencies
(
    id     SERIAL PRIMARY KEY,
    code   VARCHAR(3) UNIQUE NOT NULL,
    name   VARCHAR(20)       NOT NULL,
    symbol VARCHAR(3)
);
CREATE TRIGGER currencies_del_upd
    BEFORE DELETE OR UPDATE ON currencies
    FOR EACH ROW
    EXECUTE FUNCTION do_nothing();


CREATE TABLE currencies_history
(
    id            SERIAL PRIMARY KEY,
    currency_id   INTEGER REFERENCES currencies (id) NOT NULL,
    exchange_rate NUMERIC(13,3)                     NOT NULL DEFAULT 1.0000 CHECK ( exchange_rate > 0),
    date_and_time TIMESTAMP                          NOT NULL
);
CREATE INDEX date_and_time_idx ON currencies_history (id, date_and_time);

CREATE TRIGGER currencies_history_del_upd
    BEFORE DELETE OR UPDATE ON currencies_history
    FOR EACH ROW
    EXECUTE FUNCTION do_nothing();

/*
CREATE TABLE currencies_exchange_rates
