    currency_id   INTEGER REFERENCES currencies (id) PRIMARY KEY,
    exchange_rate NUMERIC(10, 4)                     NOT NULL DEFAULT 1.0000,
    date_and_time TIMESTAMP                          NOT NULL
);
 */
CREATE INDEX currency_code_idx ON currencies (code);

CREATE TABLE account_types
(
    id                SERIAL PRIMARY KEY,
    maintcost         NUMERIC(13,3) NOT NULL DEFAULT 0.00,
    name              VARCHAR(50)    NOT NULL,
    daily_limit_usd   NUMERIC(13,3) NOT NULL,
    monthly_limit_usd NUMERIC(13,3) NOT NULL
);

CREATE TRIGGER account_types_del
    BEFORE DELETE ON account_types
    FOR EACH ROW
    EXECUTE FUNCTION do_nothing();


CREATE TABLE clients
(
    id                     SERIAL PRIMARY KEY,
    first_name             VARCHAR(30)         NOT NULL,
    last_name              VARCHAR(30)         NOT NULL,
    second_name            VARCHAR(30),
    phone                  VARCHAR(20) UNIQUE  NOT NULL,
    email                  VARCHAR(100) UNIQUE NOT NULL,
    password_hash          CHAR(64)            NOT NULL,
    passport               VARCHAR(15) UNIQUE,
    pesel                  CHAR(11) UNIQUE,
    address                VARCHAR(100)        NOT NULL,
    correspondence_address VARCHAR(100),
    birth_date             DATE                NOT NULL
        CONSTRAINT check_data_not_null CHECK (passport IS NOT NULL OR pesel IS NOT NULL)
);
CREATE TRIGGER clients_del
    BEFORE DELETE ON clients
    FOR EACH ROW
    EXECUTE FUNCTION do_nothing();



CREATE INDEX client_email_idx ON clients (email);
CREATE INDEX client_phone_idx ON clients (phone);
CREATE TABLE accounts
(
    id            SERIAL PRIMARY KEY,
    iban          VARCHAR(34) UNIQUE NOT NULL,
    is_active     BOOLEAN            NOT NULL DEFAULT TRUE,
    opening_date  DATE,
    currency_id   INTEGER REFERENCES currencies (id),
    type_id       INTEGER REFERENCES account_types (id),
    owner_id      INTEGER REFERENCES clients (id),
    daily_limit   NUMERIC(13,3)     NOT NULL,
    monthly_limit NUMERIC(13,3)     NOT NULL
);
CREATE TRIGGER accounts_del
    BEFORE DELETE ON accounts
    FOR EACH ROW
    EXECUTE FUNCTION do_nothing();





CREATE TABLE account_balance
(
    id         INTEGER REFERENCES accounts(id) PRIMARY KEY,
    value      NUMERIC(13,3)        NOT NULL DEFAULT 0.00
);
CREATE TABLE ownerships
(
    account_id INTEGER REFERENCES accounts (id) NOT NULL,
    client_id  INTEGER REFERENCES clients (id)  NOT NULL,
    PRIMARY KEY (account_id, client_id)
);
CREATE TRIGGER ownerships_del_upd
    BEFORE DELETE OR UPDATE ON ownerships
    FOR EACH ROW
    EXECUTE FUNCTION do_nothing();

CREATE INDEX ownerships_client_idx ON ownerships (client_id);

CREATE INDEX account_client_idx ON accounts (owner_id);

CREATE TABLE card_types
(
    id                SERIAL PRIMARY KEY,
    name              VARCHAR(25)    NOT NULL,
    maintcost         NUMERIC(13,3) NOT NULL DEFAULT 0.00,
    daily_limit_usd   NUMERIC(13,3) NOT NULL,
    monthly_limit_usd NUMERIC(13,3) NOT NULL
);

CREATE TRIGGER card_types_del_upd
    BEFORE DELETE OR UPDATE ON card_types
    FOR EACH ROW
    EXECUTE FUNCTION do_nothing();

CREATE TABLE payment_methods
(
    id   SERIAL PRIMARY KEY,
    name VARCHAR(50) NOT NULL
);

CREATE TABLE cards
(
    id            SERIAL PRIMARY KEY,
    card_number   CHAR(16) UNIQUE                    NOT NULL,
    type_id       INTEGER REFERENCES card_types (id) NOT NULL,
    is_active     BOOLEAN                            NOT NULL DEFAULT TRUE,
    account_id    INTEGER REFERENCES accounts (id)   NOT NULL,
    owner_id      INTEGER REFERENCES clients (id)    NOT NULL,
    expiry_date   DATE                               NOT NULL,
    cvv           CHAR(3)                            NOT NULL,
    pin           CHAR(4)                            NOT NULL,
    daily_limit   NUMERIC(13,3)                     NOT NULL DEFAULT 0.00,
    monthly_limit NUMERIC(13,3)                     NOT NULL DEFAULT 0.00,
    payment_method_id INTEGER REFERENCES payment_methods (id) NOT NULL
);
CREATE TRIGGER cards_del
    BEFORE DELETE ON cards
    FOR EACH ROW
    EXECUTE FUNCTION do_nothing();


CREATE OR REPLACE FUNCTION cards_upd_()
RETURNS TRIGGER AS
$cards_upd_$
DECLARE

BEGIN
    IF OLD.id!=NEW.id
        OR OLD.card_number!=NEW.card_number
        OR OLD.type_id != NEW.type_id
        OR OLD.account_id != NEW.account_id
        THEN RAISE EXCEPTION 'Forbidden operation';
    END IF;
END;

$cards_upd_$
LANGUAGE plpgsql;



CREATE TRIGGER cards_upd
    BEFORE UPDATE ON cards
    FOR EACH ROW
    EXECUTE FUNCTION cards_upd_();



CREATE INDEX card_client_idx ON cards (owner_id);
CREATE TABLE transaction_types
(
    id   SERIAL PRIMARY KEY,
    name VARCHAR(50) NOT NULL,
    commission NUMERIC(4, 3) NOT NULL DEFAULT 0.00 CHECK ( 0.0<= commission AND commission<=1.0)
);

CREATE TRIGGER transaction_types_del
    BEFORE DELETE ON transaction_types
    FOR EACH ROW
    EXECUTE FUNCTION do_nothing();


CREATE TABLE transactions
(
    id                             SERIAL PRIMARY KEY,
    date_time                      TIMESTAMP,
    amount                         NUMERIC(13,3) CHECK ( amount >= 0),
    description                    VARCHAR(100),
    from_account_id                INTEGER REFERENCES accounts (id),
    to_account_id                  INTEGER REFERENCES accounts (id),
    from_card_id                   INTEGER REFERENCES cards (id),
    to_card_id                     INTEGER REFERENCES cards (id),
    type_id                        INTEGER REFERENCES transaction_types (id) NOT NULL,
    to_iban                        VARCHAR(34),
    from_iban                      VARCHAR(34),
    is_successful                  BOOLEAN                                            DEFAULT NULL,
    is_commission_paid_by_receiver BOOLEAN                                   NOT NULL DEFAULT TRUE,
    from_currency_id               INTEGER REFERENCES currencies (id)        NOT NULL
);

CREATE TRIGGER transactions_del
    BEFORE DELETE ON transactions
    FOR EACH ROW EXECUTE FUNCTION do_nothing();



CREATE OR REPLACE FUNCTION transactions_upd_()
RETURNS TRIGGER AS
$transactions_upd_$
DECLARE

BEGIN

    RETURN NEW;
END;

$transactions_upd_$
LANGUAGE plpgsql;



CREATE TRIGGER transactions_upd
