CREATE OR REPLACE FUNCTION get_user(username VARCHAR(100))
  RETURNS TABLE (id INT, password_hash CHAR(64)) AS
$get_user$
BEGIN
    RETURN QUERY (SELECT clients.id,clients.password_hash FROM clients WHERE clients.phone = username OR clients.email = username);
END;
$get_user$
LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION get_accounts(cur_id INT)
  RETURNS INT[] AS

$get_accounts$
DECLARE
    results INT[];
BEGIN
    SELECT array_agg(accounts.id) INTO results FROM accounts JOIN ownerships ON accounts.id = ownerships.account_id WHERE ownerships.client_id = cur_id;
    RETURN results;

END;
$get_accounts$
LANGUAGE plpgsql;

