CREATE OR REPLACE FUNCTION find_client_by_email_or_phone(email_ VARCHAR(100), phone_ VARCHAR(20))
  RETURNS INT AS
$find_client_by_email_or_phone$
DECLARE
    ans INT;
BEGIN
    SELECT id INTO ans FROM clients WHERE clients.email = email_ OR clients.phone = phone_;
    RETURN ans;
END;

$find_client_by_email_or_phone$
LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION generate_random_iban(type INT)
    RETURNS VARCHAR AS $$
DECLARE
    iban VARCHAR(34) := '';
    ptr INT;
BEGIN
    IF type < 0 OR type > 99 THEN
        RAISE EXCEPTION 'Invalid account type. Type must be between 0 and 99';
    END IF;

    iban := 'CH';

    FOR ptr IN 1..2 LOOP
        iban := iban || CAST(FLOOR(RANDOM() * 10)::INT AS VARCHAR(1));
    END LOOP;

    FOR ptr IN 1..14 LOOP
        iban := iban || CAST(FLOOR(RANDOM() * 10)::INT AS VARCHAR(1));
    END LOOP;

    iban := iban || '1337';
    iban := iban || '228';
    iban := iban || LPAD(CAST(type AS VARCHAR(2)), 2, '0');
    iban := iban || '0000';

    RETURN iban;
END;
$$ LANGUAGE plpgsql;




CREATE OR REPLACE FUNCTION create_account( currency_id INT, owner_id INT,type_id INT)
  RETURNS void AS
$create_account$
DECLARE
    acc_id INT;
    iban VARCHAR(34);
BEGIN
    iban = generate_random_iban(type_id);
    --RAISE EXCEPTION 'AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAa: %', get_standard_daily_limit(1,1);

    INSERT INTO accounts (iban,opening_date,currency_id,type_id, owner_id,daily_limit,monthly_limit)
    VALUES
        (iban,now(),currency_id,type_id,owner_id,get_standard_daily_limit(type_id,currency_id),get_standard_monthly_limit(type_id,currency_id));

    acc_id = get_account_id_by_iban(iban);
    INSERT INTO ownerships(account_id,client_id)
       VALUES

        (acc_id,owner_id);
    /*
    INSERT INTO account_balance(id,value)
       VALUES
        (acc_id,0);

    */
    --COMMIT;
END;
$create_account$
LANGUAGE plpgsql;


CREATE OR REPLACE FUNCTION create_client_with_pesel(first_name VARCHAR(30) , last_name varchar(30), second_name varchar(30), phone varchar(20), email varchar(100), password_hash char(64), pesel char(11), address varchar(100), correspondence_address varchar(100), birth_date DATE)
  RETURNS void AS
$create_client_with_pesel$
BEGIN
INSERT INTO clients (first_name, last_name, second_name, phone, email, password_hash, passport,pesel, address, correspondence_address, birth_date)
VALUES
    (first_name, last_name, second_name, phone,email,password_hash,NULL,pesel,address,correspondence_address,birth_date);

RAISE NOTICE 'ID = %',find_client_by_email_or_phone(email,phone);
PERFORM create_account(1,find_client_by_email_or_phone(email,phone),1);

END;
$create_client_with_pesel$
