CREATE OR REPLACE FUNCTION create_client_with_passport(first_name VARCHAR(30) , last_name varchar(30), second_name varchar(30), phone varchar(20), email varchar(100), password_hash char(64), passport VARCHAR(15), address varchar(100), correspondence_address varchar(100), birth_date DATE)
  RETURNS void AS
