CREATE OR REPLACE FUNCTION get_exchange_rate(currency_id_ INT,t timestamp)
  RETURNS NUMERIC(13,3) AS $get_exchange_rate$
DECLARE
    exchange_rate_ NUMERIC(13,3);
    last_upd timestamp;
BEGIN
    --use currencies_history to get latest exchange rate
    SELECT MAX(date_and_time) INTO last_upd FROM currencies_history WHERE date_and_time<= t AND id=currency_id_ GROUP BY id;
    --RAISE NOTICE 'currency_id = %', currency_id_;
    SELECT exchange_rate INTO exchange_rate_ FROM currencies_history WHERE currencies_history.id = currency_id_ AND date_and_time = last_upd;
    --RAISE NOTICE 'rate  = %', exchange_rate_;
    RETURN exchange_rate_;
END;
$get_exchange_rate$
LANGUAGE plpgsql;

