CREATE OR REPLACE FUNCTION find_currency(currency_name VARCHAR(3))
  RETURNS INT AS $find_currency$
DECLARE
    currency_id INT;
BEGIN
    SELECT currencies.id INTO currency_id FROM currencies WHERE currencies.code = currency_name;
    RETURN currency_id;
END;
$find_currency$
LANGUAGE plpgsql;
CREATE OR REPLACE FUNCTION convert_currency(amount NUMERIC(13,3), from_currency_id INT, to_currency_id INT)
  RETURNS NUMERIC(13,3) AS $convert_currency$
DECLARE
    from_currency_rate NUMERIC(13,3);
    to_currency_rate NUMERIC(13,3);
    converted_amount NUMERIC(13,3);
    current_time timestamp;
BEGIN
    --RAISE NOTICE 'amount: %', amount;
    from_currency_rate = get_exchange_rate(from_currency_id,now()::timestamp);
    to_currency_rate = get_exchange_rate(to_currency_id,now()::timestamp);
    converted_amount := amount * from_currency_rate / to_currency_rate;
    RETURN converted_amount;
END;
$convert_currency$
LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION get_from_amount(id_ INT)
RETURNS NUMERIC(13,3) AS
$get_from_amount$
DECLARE
    cur transactions%rowtype;
BEGIN
    select * INTO cur FROM transactions WHERE id=id_;
    IF cur.is_commission_paid_by_receiver = TRUE THEN
        return cur.amount;
    ELSE
        return cur.amount*(1.0-get_commission(cur.type_id));
    end if;
END;
$get_from_amount$
LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION get_to_amount(id_ INT)
RETURNS NUMERIC(13,3) AS
$get_to_amount$
DECLARE
    cur transactions%rowtype;
    rate1 NUMERIC(13,3);
    rate2 NUMERIC(13,3);
    sum NUMERIC(13,3);
BEGIN
    select * INTO cur FROM transactions WHERE id=id_;
    IF cur.to_account_id IS NULL THEN
        BEGIN
            --RAISE NOTICE 'ABOBA';
            RETURN NULL;
        END;
    END IF;

    rate1 = get_exchange_rate(cur.from_currency_id,cur.date_time);
    rate2 = get_exchange_rate(get_account_currency(cur.to_account_id),cur.date_time);
    sum = cur.amount*rate1/rate2;
    IF cur.is_commission_paid_by_receiver = TRUE THEN
        --RAISE NOTICE 'sum: %', sum;
        return sum*(1.0-get_commission(cur.type_id));
    ELSE
        return sum;
    end if;
END;
$get_to_amount$
LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION get_balance_check(id_ INTEGER)
RETURNS NUMERIC(13,3) AS $get_balance$
DECLARE
    add_ NUMERIC(13,3);
    sub_ NUMERIC(13,3);
BEGIN

    SELECT SUM(get_from_amount(id)) INTO sub_ FROM transactions WHERE from_account_id = id_ AND (is_successful = TRUE OR is_successful IS NULL);
    SELECT SUM(get_to_amount(id)) INTO add_ FROM transactions WHERE to_account_id = id_ AND (is_successful = TRUE OR is_successful IS NULL);
    RAISE NOTICE 'add: %', add_;
    RAISE NOTICE 'sub: %', sub_;
    IF add_ IS NULL THEN
        add_ = 0.0;
    end if;
    IF sub_ IS NULL THEN
        sub_ = 0.0;
    end if;
    RETURN add_-sub_;
    /*
    SELECT value INTO result FROM account_balance WHERE id=id_;
    RETURN result;

     */

END;
$get_balance$
LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION get_balance(id_ INTEGER)
RETURNS NUMERIC(13,3) AS $get_balance$
DECLARE
    add_ NUMERIC(13,3);
    sub_ NUMERIC(13,3);
BEGIN
    SELECT SUM(get_from_amount(id)) INTO sub_ FROM transactions WHERE from_account_id = id_ AND is_successful IS NOT NULL AND is_successful = TRUE;

    SELECT SUM(get_to_amount(id)) INTO add_ FROM transactions WHERE to_account_id = id_ AND is_successful IS NOT NULL AND is_successful = TRUE;

    IF add_ IS NULL THEN
        add_ = 0.0;
    end if;
    IF sub_ IS NULL THEN
        sub_ = 0.0;
    end if;
    RETURN add_-sub_;
    /*
    SELECT value INTO result FROM account_balance WHERE id=id_;
    RETURN result;

     */

END;

$get_balance$
LANGUAGE plpgsql;
CREATE OR REPLACE FUNCTION get_standard_daily_limit(type INT,currency INT)
  RETURNS NUMERIC(13,3) AS $get_standard_daily_limit$
DECLARE
    daily_limit NUMERIC(13,3);
BEGIN
    --RAISE NOTICE 'type: %', find_currency('USD');
    SELECT convert_currency(account_types.daily_limit_usd,find_currency('USD'),currency) INTO daily_limit FROM account_types WHERE account_types.id = type;
    RETURN daily_limit;
END;
$get_standard_daily_limit$
LANGUAGE plpgsql;

