CREATE OR REPLACE FUNCTION get_transaction_ids_by_account(
    account_id INTEGER
) RETURNS TABLE (
    id INTEGER
)
AS $$
BEGIN
    RETURN QUERY
    SELECT
        transactions.id
    FROM
        transactions
    WHERE
        from_account_id = account_id OR to_account_id = account_id
    ORDER BY
        date_time DESC;
END;
$$ LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION get_transaction_description_by_id(
    transaction_id INTEGER
) RETURNS VARCHAR(100)
AS $$
DECLARE
    transaction_description VARCHAR(100);
BEGIN
    SELECT description INTO transaction_description
    FROM transactions
    WHERE id = transaction_id;

    RETURN transaction_description;
END;
$$ LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION get_sender_account_by_transaction_id(
    transaction_id INTEGER
) RETURNS INTEGER
AS $$
DECLARE
    sender_account_id INTEGER;
BEGIN
    SELECT from_account_id INTO sender_account_id
    FROM transactions
    WHERE id = transaction_id;

    RETURN sender_account_id;
