CREATE OR REPLACE FUNCTION change_account_daily_limit(
    account_id_ INTEGER,
    new_limit_ NUMERIC(13,3)
) RETURNS VOID AS
$change_account_daily_limit$
DECLARE
    cur cards%rowtype;
BEGIN
    UPDATE accounts SET daily_limit = new_limit_ WHERE id = account_id_;
    FOR cur in (SELECT * FROM cards WHERE cards.account_id = id) LOOP
        IF cur.daily_limit > new_limit_ THEN
            PERFORM change_card_daily_limit(cur.id, new_limit_);
        END IF;
    END LOOP;
END;
