CREATE OR REPLACE FUNCTION validate_pesel()
    RETURNS TRIGGER AS $validate_pesel$
DECLARE
    pos INT := 1;
    sum1 INT := 0;
BEGIN
    IF NEW.pesel IS NULL THEN
        RAISE NOTICE 'PESEL IS NULL';
        RETURN NEW;
    END IF;
    LOOP
        IF pos > 11 THEN
            EXIT;
        END IF;

        IF pos = 11 THEN
            EXIT;
        END IF;

        IF ascii(SUBSTRING(NEW.pesel, pos, 1)) >= ascii('0') AND ascii(SUBSTRING(NEW.pesel, pos, 1)) <= ascii('9') THEN
        ELSE
            RAISE EXCEPTION 'Niepoprawny PESEL';
        END IF;

        IF (pos % 4) = 0 THEN
            sum1 := sum1 + (ascii(SUBSTRING(NEW.pesel, pos, 1)) - ascii('0')) * 9;
        ELSIF (pos % 4) = 1 THEN
            sum1 := sum1 + (ascii(SUBSTRING(NEW.pesel, pos, 1)) - ascii('0')) * 1;
        ELSIF (pos % 4) = 2 THEN
            sum1 := sum1 + (ascii(SUBSTRING(NEW.pesel, pos, 1)) - ascii('0')) * 3;
        ELSIF (pos % 4) = 3 THEN
            sum1 := sum1 + (ascii(SUBSTRING(NEW.pesel, pos, 1)) - ascii('0')) * 7;
        END IF;

        pos := pos + 1;
    END LOOP;

    IF NOT (((10 - (sum1 % 10)) % 10) = ascii(SUBSTRING(NEW.pesel, 11, 1)) - ascii('0')) THEN
        RAISE EXCEPTION 'Niepoprawny PESEL';
    END IF;

    RETURN NEW;
END;
$validate_pesel$ LANGUAGE plpgsql;

CREATE TRIGGER trigger_validate_pesel
    BEFORE INSERT OR UPDATE ON clients
    FOR EACH ROW
    EXECUTE FUNCTION validate_pesel();






CREATE OR REPLACE FUNCTION validate_email()
    RETURNS TRIGGER AS $validate_email$
BEGIN
    IF NEW.email IS NULL THEN
        RAISE EXCEPTION 'No email';
    END IF;
    IF NEW.email !~* '^[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,}$' THEN
        RAISE EXCEPTION 'Invalid email format';
    END IF;


    RETURN NEW;
END;
$validate_email$ LANGUAGE plpgsql;

CREATE TRIGGER trigger_validate_email
    BEFORE INSERT OR UPDATE ON clients
    FOR EACH ROW
    EXECUTE FUNCTION validate_email();

CREATE OR REPLACE FUNCTION validate_phone()
    RETURNS TRIGGER AS $validate_phone$
BEGIN
    IF NEW.phone IS NULL THEN
        RAISE EXCEPTION 'No phone';
    END IF;

    -- Phone number validation using regular expression pattern
    IF NEW.phone !~* '^\+[0-9]*$' THEN
        RAISE EXCEPTION 'Invalid phone number format';
    END IF;

    RETURN NEW;
END;
$validate_phone$ LANGUAGE plpgsql;

CREATE TRIGGER trigger_validate_phone
    BEFORE INSERT OR UPDATE ON clients
    FOR EACH ROW
    EXECUTE FUNCTION validate_phone();



CREATE OR REPLACE FUNCTION validate_name()
    RETURNS TRIGGER AS $validate_name$
BEGIN
    IF NEW.first_name IS NULL THEN
        RAISE EXCEPTION 'First name is required';
    END IF;

    IF NEW.last_name IS NULL THEN
        RAISE EXCEPTION 'Last name is required';
    END IF;

    -- Validate that only English capital letters are used in the name fields
    IF NEW.first_name ~ '[^A-Z]' THEN
        RAISE EXCEPTION 'First name should only contain English capital letters';
    END IF;
    IF NEW.second_name IS NOT NULL THEN
        IF NEW.second_name ~ '[^A-Z]' THEN
            RAISE EXCEPTION 'Second name should only contain English capital letters';
        END IF;
    END IF;
    IF NEW.last_name ~ '[^A-Z]' THEN
        RAISE EXCEPTION 'Last name should only contain English capital letters';
    END IF;

    RETURN NEW;

END;
$validate_name$ LANGUAGE plpgsql;
CREATE TRIGGER trigger_validate_name
    BEFORE INSERT OR UPDATE ON clients
    FOR EACH ROW
    EXECUTE FUNCTION validate_name();

