CREATE OR REPLACE FUNCTION validate_balance_before_transaction()
RETURNS TRIGGER AS
$validate_balance_before_transaction$
DECLARE
BEGIN
    IF NEW.from_card_id is not null AND NEW.to_card_id is not null THEN
        RAISE EXCEPTION 'wrond transaction type';
    end if;
    IF NEW.to_card_id is not null AND (NEW.to_account_id is null or NEW.to_account_id != get_linked_account_id(NEW.to_card_id))THEN
        RAISE EXCEPTION 'wrong to account';
    END IF;
    IF NEW.from_card_id is not null AND (NEW.from_account_id is null or NEW.from_account_id != get_linked_account_id(NEW.from_card_id))THEN
        RAISE EXCEPTION 'wrong to account';
    END IF;
    IF NEW.from_account_id is null AND NEW.to_account_id is null THEN
        RAISE EXCEPTION 'Not our transaction';
    END IF;
    IF NEW.from_account_id is not null AND NEW.to_account_id is not null AND NEW.from_account_id = NEW.to_account_id THEN
        RAISE EXCEPTION 'Transfer from and to the same account';
    END IF;
    RETURN NEW;

END;
$validate_balance_before_transaction$
LANGUAGE plpgsql;

CREATE TRIGGER trigger_validate_balance_before_transaction
    AFTER INSERT ON transactions
    FOR EACH ROW
    EXECUTE FUNCTION validate_balance_before_transaction();



CREATE OR REPLACE FUNCTION money_spent_from_account(id_ INT,L timestamp, R timestamp)
RETURNS NUMERIC(13,3) AS $money_spent_from_account$
DECLARE
    spent NUMERIC(13,3);
BEGIN
    SELECT SUM(amount) INTO spent FROM transactions WHERE transactions.from_account_id = id_ AND transactions.date_time >= L AND transactions.date_time < R AND (transactions.is_successful IS NULL OR transactions.is_successful = TRUE);
    IF spent IS NULL THEN
        RETURN 0.0;
    END IF;
    RETURN spent;
END;
$money_spent_from_account$
LANGUAGE plpgsql;

