CREATE OR REPLACE FUNCTION validate_balance_after_transaction()
RETURNS TRIGGER AS
$validate_balance_after_transaction$
DECLARE
    cur NUMERIC(13,3);
    daily_limit NUMERIC(13,3);
    monthly_limit NUMERIC(13,3);
BEGIN

    IF NEW.from_card_id IS NOT NULL AND is_card_blocked(NEW.from_card_id) THEN
        RAISE NOTICE 'Card is blocked';
        UPDATE transactions SET is_successful = FALSE WHERE id = NEW.id;
        NEW.is_successful := FALSE;
        RETURN NEW;
    END IF;
    IF NEW.to_card_id IS NOT NULL AND is_card_blocked(NEW.to_card_id) THEN
        RAISE NOTICE 'Card is blocked';
        UPDATE transactions SET is_successful = FALSE WHERE id = NEW.id;
        NEW.is_successful := FALSE;
        RETURN NEW;
    END IF;


    IF NEW.from_account_id IS NOT NULL AND is_account_blocked(NEW.from_account_id) THEN
        RAISE NOTICE 'Account is blocked';
        UPDATE transactions SET is_successful = FALSE WHERE id = NEW.id;
        NEW.is_successful := FALSE;
        RETURN NEW;
    END IF;
    IF NEW.to_account_id IS NOT NULL AND is_account_blocked(NEW.to_account_id) THEN
        RAISE NOTICE 'Account is blocked';
        UPDATE transactions SET is_successful = FALSE WHERE id = NEW.id;
        NEW.is_successful := FALSE;
        RETURN NEW;
    END IF;




    IF NEW.from_account_id IS NULL THEN
        BEGIN
            UPDATE transactions SET is_successful = TRUE WHERE id = NEW.id;
            NEW.is_successful := TRUE;
            RETURN NEW;
        END;
    END IF;
    cur = get_balance_check(NEW.from_account_id);

    RAISE NOTICE 'Checking balance %',cur;



    IF get_balance_check(NEW.from_account_id) < 0.0 THEN
        BEGIN
            RAISE NOTICE 'Balance is too low';
            UPDATE transactions SET is_successful = FALSE WHERE id = NEW.id;
            NEW.is_successful := FALSE;
            RETURN NEW;
        END;
    END IF;
    --IF get_spent_money_ get_daily_limit_account(NEW.from_account_id);

    daily_limit = get_daily_limit_account(NEW.from_account_id);
    monthly_limit = get_monthly_limit_account(NEW.from_account_id);
    RAISE NOTICE 'CNT = %',(select count(*) from transactions where transactions.from_account_id = NEW.from_account_id AND transactions.date_time >= current_date::timestamp AND transactions.date_time < (current_date + INTERVAL '1 day')::timestamp);
    RAISE NOTICE 'Daily limit %',daily_limit;
    RAISE NOTICE 'Daily spent %',money_spent_from_account(NEW.from_account_id,current_date::timestamp,(current_date + INTERVAL '1 day')::timestamp);
    IF daily_limit < money_spent_from_account(NEW.from_account_id,current_date::timestamp,(current_date + INTERVAL '1 day')::timestamp) OR
       monthly_limit < money_spent_from_account(NEW.from_account_id,date_trunc('month', current_date)::timestamp,(date_trunc('month', current_date) + interval '1 month')::timestamp )
    THEN
        RAISE NOTICE 'Daily or monthly limit is exceeded? % %',money_spent_from_account(NEW.from_account_id,current_date::timestamp,(current_date + INTERVAL '1 day')::timestamp),monthly_limit;
        UPDATE transactions SET is_successful = FALSE WHERE id = NEW.id;
        NEW.is_successful := FALSE;
        RETURN NEW;
    END IF;

    IF NEW.from_card_id IS NOT NULL
    THEN
        daily_limit = get_card_daily_limit(NEW.from_card_id);
        monthly_limit = get_card_monthly_limit(NEW.from_card_id);
        IF daily_limit < money_spent_from_card(NEW.from_card_id,current_date::timestamp,(current_date + INTERVAL '1 day')::timestamp) OR
            monthly_limit < money_spent_from_card(NEW.from_card_id,date_trunc('month', current_date)::timestamp,(date_trunc('month', current_date) + interval '1 month')::timestamp) THEN
            RAISE NOTICE 'Daily or monthly limit is exceeded!!!!!!!!!';
            UPDATE transactions SET is_successful = FALSE WHERE id = NEW.id;
            NEW.is_successful := FALSE;
            RETURN NEW;
        END IF;
    END IF;


    RAISE NOTICE 'Balance is ok';
    UPDATE transactions SET is_successful = TRUE WHERE id = NEW.id;
    NEW.is_successful := TRUE;
    RETURN NEW;
END;

$validate_balance_after_transaction$
LANGUAGE plpgsql;

CREATE TRIGGER trigger_validate_balance_after_transaction
    AFTER INSERT ON transactions
    FOR EACH ROW
    EXECUTE FUNCTION validate_balance_after_transaction();


CREATE OR REPLACE FUNCTION normalize_(a NUMERIC(13,3),b NUMERIC(13,3))
RETURNS numeric as $normalize$
BEGIN
    IF a IS NULL THEN RETURN b;
    END IF;
    IF a>b THEN RETURN b;
    END IF;
    return a;
END;
$normalize$
LANGUAGE plpgsql;



CREATE OR REPLACE FUNCTION check_card_limits()
RETURNS TRIGGER AS $check_card_limits$
    DECLARE
    BEGIN
        --RAISE EXCEPTION 'SUUUUUUUUUUUUUUUUUUUUUUUUUUUS';
        NEW.daily_limit = normalize_(NEW.daily_limit,normalize_(get_standard_daily_limit_card(NEW.type_id,get_account_currency(NEW.account_id)),get_daily_limit_account(NEW.account_id)));
        NEW.monthly_limit = normalize_(NEW.monthly_limit,normalize_(get_standard_monthly_limit_card(NEW.type_id,get_account_currency(NEW.account_id)),get_monthly_limit_account(NEW.account_id)));
        RETURN NEW;

    END;
$check_card_limits$
LANGUAGE plpgsql;

CREATE TRIGGER create_trigger_on_card
    BEFORE INSERT OR UPDATE ON cards
    FOR EACH ROW
    EXECUTE FUNCTION check_card_limits();


